import { ADD_FAVORITE_CHARACTER, DELETE_FAVORITE_CHARACTER } from './type';

export function addFavoriteCharacter(character) {
 return { type: ADD_FAVORITE_CHARACTER, payload: character }
}

export function deleteFavoriteCharacter(id) {
 return { type: DELETE_FAVORITE_CHARACTER, payload: id }
}

export function filterCards(status) {
 return { type: filterCards, payload: status }
}

export function orderCards(id) {
 return { type: orderCards, payload: id }
}
